cy.request({
  method: 'POST',
  url: 'https://qc-test.atmatech.id/api/login',
  body: {
    username: validUsername,
    password: validPassword
  }
}).then(response => {
  expect(response.status).to.eq(200);
  expect(response.body).to.have.property('accessToken');
  token = response.body.accessToken;
});

cy.request({
  method: 'POST',
  url: 'https://qc-test.atmatech.id/api/login',
  body: {
    username: invalidUsername,
    password: invalidPassword
  },
  failOnStatusCode: false
}).then(response => {
  expect(response.status).to.eq(400);
  expect(response.body).to.have.property('message', 'Nama pengguna atau kata sandi salah.');
});

cy.request({
  method: 'GET',
  url: 'https://qc-test.atmatech.id/api/me/',
  headers: {
    Authorization: `Bearer ${token}`
  }
}).then(response => {
  expect(response.status).to.eq(200);
  expect(response.body).to.have.property('_id');
  expect(response.body).to.have.property('username');
});

cy.request({
  method: 'GET',
  url: 'https://qc-test.atmatech.id/api/me/',
  headers: {
    Authorization: 'Bearer invalidToken'
  },
  failOnStatusCode: false
}).then(response => {
  expect(response.status).to.eq(401);
  expect(response.body).to.have.property('message', 'Unauthorized');
});

const newProfileData = {
  fullName: 'Super Admin',
  email: 'new@superadmin.com'
};
cy.request({
  method: "PUT",
  url: 'https://qc-test.atmatech.id/api/me/',
  headers: {
    Authorization: `Bearer ${token}`
  },
  body: newProfileData
}).then(response => {
  expect(response.status).to.eq(200);
  expect(response.body).to.have.property('_id');
  expect(response.body.email).to.eq(newProfileData.email);
  expect(response.body.fullName).to.eq(newProfileData.fullName);
});
